import Preloader from "./Preloader";
const MainPage = lazy(()=>import("./MainPage"))


class Main extends Component {
    render() {
            return (
                <Suspense fallback={<Preloader/>}>

               <MainPage/>
                </Suspense>
            );
    }
}

export default Main;
